function nowUTC(offset){
		let now = new Date;
		let utc_timestamp = Date.UTC(now.getUTCFullYear(), now.getUTCMonth(), now.getUTCDate(),
			now.getUTCHours(), now.getUTCMinutes(), now.getUTCSeconds());

		var hohoho = new Date(utc_timestamp - offset * 3600 * 1000);


		return hohoho.getFullYear() + "-" + ("0" + (hohoho.getMonth() + 1)).substr(-2) + "-" + ("0" + hohoho.getDate()).substr(-2) + " " + ("0" + hohoho.getHours()).substr(-2) + ":" + ("0" + hohoho.getMinutes()).substr(-2) + ":" + ("0"+hohoho.getSeconds()).substr(-2);
	}
